import React from "react";

class SheepImg extends React.Component {
  render() {
    return (
      <img
        src="https://i.pinimg.com/originals/ec/81/8a/ec818a604b44f9e451405dc448fd4ac9.jpg"
        alt="baby sheep"
      />
    );
  }
}

export default SheepImg;
